/* Flattened Modelica model:

function FOWT.Aerodynamics_Lib.Common.Functions.inductionFactor
discrete input Real Vwind_x "Upstream wind velcotiy";
discrete input Real Vwind_y "Blade linear speed at radius r";
discrete input Real local_twist;
discrete input Real be "Local blade twist angle [deg]";
discrete input Real AoA_data[:, :];
discrete input Real CL_data[:, :];
discrete input Real CD_data[:, :] "Airfoil data for interpolation";
discrete input Real sigma;
discrete input Real B "Rotor solidity, number of blades";
discrete input Real S_blade "Total blade length";
discrete input Real r "Local blade radius (r=0 at root, r=S_blade at tip)";
input Boolean tipLoss(start = true) "Tip loss ON/OFF toggle";
input Boolean hubLoss(start = true) "Hub loss ON/OFF toggle";
discrete output Real a;
discrete output Real ap "Axial induction factor (a), Tangential induction factor (a')";
discrete output Real CN;
discrete output Real CT "Normal/thrust, Tangential/torque force coeff.";
discrete output Real phi;
discrete output Real AoA_deg "Inflow angle [rad], Angle of attack [deg]";
discrete output Real CL;
discrete output Real CD "Interpolated coeff. of lift and drag";
discrete output Real N_Iter "Number of iterations";
protected 
constant Real pi = 3.141592653589793;
constant Integer NMAX = 500 "Max. iterations";
constant Real delta = 1E-06 "Threshold for convergence";
discrete Real a_prvs;
discrete Real ap_prvs "Previous a and a' used to end algorithm prematuraly";
discrete Real CNTR "Counter used to end algorithm prematurely";
discrete Real CNTR_MAX(start = 2) "Maximum number of repetitive iterations";
discrete Real epsilon(start = 0.001) "Change threshold before premature breaking is considered";
discrete Real NDX "Index of interpolated data. We don't need it";
discrete Real AoA "Angle of attack [rad]";
discrete Real F_tip;
discrete Real f_tip "Prandtl's tip loss factor, exponential term";
discrete Real F_hub;
discrete Real f_hub "Prandtl's hub loss factor, exponential term";
discrete Real F "Prandtl's tip-hub loss factor";
discrete Real fzero "Residual function";
discrete Real k;
discrete Real kp;
discrete Real Y1;
discrete Real Y2;
discrete Real Y3 "Convenience parameters (simplifies equatiosn)";
discrete Real sphi;
discrete Real cphi "Pre-computed sin(phi), cos(phi)";
discrete Real R_hub(start = 5.53) "Hub radius. >>>>> PARAMETARIZE THIS <<<<<";
discrete Real R_rotor "Total turbine radius (= R_hub + S_blade)";
discrete Real r_rotor "Local turbine radius (= R_hub + r; =0 at hub; =R_rotor at blade tip)";
discrete Real TSR_r "Tip speed ratio at radius r_rotor from hub";
discrete Real c1(start = 0.125) "Shen's correction coefficient 1";
discrete Real c2(start = 21.0) "Shen's correction coefficient 2";
discrete Real g "Shen's correction fucntion";
public 
algorithm 
if (Vwind_x == 0) then 
a := 0;
ap := 0;
CN := 0;
CT := 0;
phi := 0;
AoA_deg := 0;
CL := 0;
CD := 0;
N_Iter := 0;
return;
end if;
R_rotor := R_hub+S_blade;
r_rotor := R_hub+r;
TSR_r := Vwind_y/Vwind_x;
a := 0;
a_prvs := 0;
ap := 0;
ap_prvs := 0;
CNTR := 0;
for i in (1:NMAX) loop
N_Iter := i;
phi := atan2(Vwind_x*(1-a), Vwind_y*(1+ap));
AoA := phi-(be+local_twist*pi/180);
AoA_deg := AoA*180/pi;
sphi := sin(phi);
cphi := cos(phi);
CL := Modelica.Math.Vectors.interpolate(vector(AoA_data), vector(CL_data), AoA_deg, 1);
CD := Modelica.Math.Vectors.interpolate(vector(AoA_data), vector(CD_data), AoA_deg, 1);
CN := CD*sphi+CL*cphi;
CT := CL*sphi-CD*cphi;
if (tipLoss) then 
g := exp( -c1*(B*TSR_r-c2))+0.1;
f_tip := FOWT.Common.Functions.noDivideByZero(B/2*(1-r_rotor/R_rotor), r_rotor/R_rotor*abs(sphi), 1E-15);
F_tip := 2/pi*acos(exp( -g*f_tip));
else
F_tip := 1;
end if;
if (hubLoss) then 
f_hub := FOWT.Common.Functions.noDivideByZero(B/2*(r_rotor-R_hub), r_rotor*abs(sphi), 1E-15);
F_hub := 2/pi*acos(exp( -f_hub));
else
F_hub := 1;
end if;
F := F_tip*F_hub;
k := FOWT.Common.Functions.noDivideByZero(sigma*CN, 4*F*sphi^2, 1E-15);
kp := FOWT.Common.Functions.noDivideByZero(sigma*CT, 4*F*sphi*cphi, 1E-15);
TSR_r := Vwind_y/Vwind_x;
if (phi > 0) then 
if (k <= 0.6666666666666666) then 
a := k/(1+k);
else
Y1 := 2*F*k-(1.1111111111111112-F);
Y2 := 2*F*k-F*(1.3333333333333333-F);
Y3 := 2*F*k-(2.7777777777777777-2*F);
if (abs(Y3) < 1E-06) then 
a := 1.0-0.5/sqrt(Y2);
else
a := (Y1-sqrt(Y2))/Y3;
end if;
end if;
fzero := sphi/(1-a)-FOWT.Common.Functions.noDivideByZero(cphi, TSR_r, 1E-15)*(1-kp);
else
if (k > 1) then 
a := k/(k-1);
else
a := 0;
end if;
fzero := sphi*(1-k)-FOWT.Common.Functions.noDivideByZero(cphi, TSR_r, 1E-15)*(1-kp);
end if;
if (Vwind_x > 0) then 
ap := kp/(1-kp);
else
ap :=  -kp/(1+kp);
end if;
if (abs(fzero) <= delta) then 
break;
end if;
if (abs(a-a_prvs) <= epsilon) then 
CNTR := CNTR+1;
if (CNTR == CNTR_MAX) then 
break;
end if;
else
a_prvs := a;
ap_prvs := ap;
CNTR := 0;
end if;
end for;
end FOWT.Aerodynamics_Lib.Common.Functions.inductionFactor;

  */
